import { BrowserRouter, Routes, Route } from "react-router-dom";
import aditya from "./components/navbar";

function App() {
  return (
    <BrowserRouter>
      <aditya />
      <Routes>
        <Route path="/" element={<Landing />}></Route>   
        <Route path="/login" element={<Login />}></Route>    
      </Routes>
    </BrowserRouter>
  );
}

export default App;
